import React from "react";

const ExpenseList = ({ expenseList }) => {
  onDelete = (event) => {
    this.setState({ expenseList: "" });
  };
  return (
    <div className="card" style={{ margin: 10 }}>
      <li>
        {expenseList}
        <i className="trash alternate icon" onClick={this.onDelete} />
      </li>
      <li>{expenseList}</li>
    </div>
  );
};

export default ExpenseList;
